import React from "react";
import Layout from "../components/Layout";
import "../assets/Home.css";

const Home = () => {
  return (
    <Layout>
      <div className="home-container">
        <h1 className="home-header">Relatórios Financeiros</h1>

        <div className="dashboard-grid">
          <div className="info-card">
            <h3>Gráfico 1</h3>
            <p>Espaço reservado para gráfico de saldo geral.</p>
          </div>
          <div className="info-card">
            <h3>Gráfico 2</h3>
            <p>Espaço reservado para comparação de receitas e despesas.</p>
          </div>
          <div className="info-card">
            <h3>Gráfico 3</h3>
            <p>Espaço reservado para análise mensal.</p>
          </div>
          <div className="info-card">
            <h3>Gráfico 4</h3>
            <p>Espaço reservado para metas vs. realizado.</p>
          </div>
        </div>
      </div>
    </Layout>
  );
};

export default Home;
